import {Navbar, NavItem} from "react-bootstrap";

export default function FooterNavBar(){
    return(
        <div>
            <Navbar>
                <NavItem> Item 1</NavItem>
                <NavItem> Item 2</NavItem>
                <NavItem> Item 3</NavItem>
            </Navbar>
        </div>
    )
}
